@Po_USA_Stock エンジョイ勢は、まぁ壁でいいかという結論になりそうですが

大会に出るようなガチ勢の需要はめちゃくちゃ高いと思います

あと、子供にテニス教えてるんですがこれあったら幅が広がりそうだなと思います。フォームをネット越しでなく近くで指摘できるのが利点。買うかもしれません

